 export  default   class  Calcshow extends  React.Component{
    constructor(props){
          super(props)
          this.state={
              show:""
          }
    }
    render(){
         return    <div id="input">
                           <div id="circles">
                               <div></div>
                               <div></div>
                               <div></div>
                           </div>
                           <div id="show"></div>
                    </div>
    }
}
